import './App.css';
import { EuiText, EuiSpacer } from "@elastic/eui";

function App() {
  return (
<div style={{ maxWidth: 600, padding: 32 }}>
    <EuiText>
      <h3>EUI sandbox</h3>
      <p>
        HELLO WORLD
      </p>
      <p>
        The component below exists only in the sandbox. Edit its contents in the
        `src/components` directory to begin hacking.
      </p>
    </EuiText>
    <EuiSpacer />
  </div>
  );
}

export default App;
